import { BrowserRouter, Routes, Route, NavLink } from "react-router-dom";
import React from "react";
import Nav from "./components/Nav/Nav";

function App() {
  return (
    <BrowserRouter>
      <Nav />
      <Routes>
        <Route path="/" index element></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
